import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom';
import './index.css';
import App from './App';
import { AuthProvider } from './assets/Context/AuthContext';
import { CartProvider } from './assets/Context/CartContext';
import { OrderProvider } from './assets/Context/OrderContext';
import { NotificationProvider } from './assets/Context/NotificationContext';
import { ProductProvider } from './assets/Context/ProductContext';
import { AppProvider } from './assets/Context/AppContext';

// Error boundary for better error handling
class ErrorBoundary extends React.Component {
  constructor(props) {
    super(props);
    this.state = { hasError: false };
  }

  static getDerivedStateFromError(error) {
    return { hasError: true };
  }

  componentDidCatch(error, errorInfo) {
    console.error('Error caught by boundary:', error, errorInfo);
  }

  render() {
    if (this.state.hasError) {
      return (
        <div className="min-h-screen flex items-center justify-center bg-gray-100">
          <div className="text-center">
            <h1 className="text-2xl font-bold text-gray-900 mb-4">
              Oops! Something went wrong üçï
            </h1>
            <p className="text-gray-600 mb-6">
              We're having trouble loading the food delivery app.
            </p>
            <button 
              onClick={() => window.location.reload()}
              className="px-6 py-3 bg-orange-500 text-white rounded-lg hover:bg-orange-600 transition-colors"
            >
              Refresh Page
            </button>
          </div>
        </div>
      );
    }

    return this.props.children;
  }
}

// Create root and render app with all providers
const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
    <ErrorBoundary>
      <BrowserRouter>
        <AppProvider>
          <AuthProvider>
            <NotificationProvider>
              <ProductProvider>
                <CartProvider>
                  <OrderProvider>
                    <App />
                  </OrderProvider>
                </CartProvider>
              </ProductProvider>
            </NotificationProvider>
          </AuthProvider>
        </AppProvider>
      </BrowserRouter>
    </ErrorBoundary>
  </React.StrictMode>
);

// Performance monitoring (optional)
if (process.env.NODE_ENV === 'development') {
  if (module.hot) {
    module.hot.accept('./App', () => {
      const NextApp = require('./App').default;
      root.render(
        <React.StrictMode>
          <ErrorBoundary>
            <BrowserRouter>
              <AppProvider>
                <AuthProvider>
                  <NotificationProvider>
                    <ProductProvider>
                      <CartProvider>
                        <OrderProvider>
                          <NextApp />
                        </OrderProvider>
                      </CartProvider>
                    </ProductProvider>
                  </NotificationProvider>
                </AuthProvider>
              </AppProvider>
            </BrowserRouter>
          </ErrorBoundary>
        </React.StrictMode>
      );
    });
  }
}

// Service worker registration (optional)
if ('serviceWorker' in navigator && process.env.NODE_ENV === 'production') {
  window.addEventListener('load', () => {
    navigator.serviceWorker.register('/sw.js')
      .then((registration) => {
        console.log('SW registered: ', registration);
      })
      .catch((registrationError) => {
        console.log('SW registration failed: ', registrationError);
      });
  });
}
